	public static int maxVowels(String s, int k) {
        
	int rep = 0;
	int tsize = 0;
	Map<Integer,Character> myMap = new HashMap<>();
	for(int r=0,l=0;r<s.length();r++) {
		if(r==k||r-l>=k) {	
			myMap.remove(l);
			l++;
		}
		if(s.charAt(r)=='a'||s.charAt(r)=='e'||
				s.charAt(r)=='i'||s.charAt(r)=='o'||s.charAt(r)=='u') {
			myMap.put(r,s.charAt(r));
			tsize = myMap.size();
			rep=rep<tsize?tsize:rep;
		}
    }
	return rep;
}
	public boolean isVowel(char c) {
		List<Character> a = new ArrayList<>(); 
		a.add('a');
		a.add('e');
		a.add('i');
		a.add('o');
		a.add('u');
		if (a.contains(c)) {
			return true;
		}
		return false;
	}
	public static int maxVowelsMine(String s, int k) {
		int rep = 0;
		int tsize = 0;
		Map<Integer,Character> myMap = new HashMap<>();
		char[] sc = s.toCharArray();
		leet_1456 lee = new leet_1456();
		for(int r=0,l=0;r<s.length();r++) {
			if(r==k||r-l>=k) {	
				myMap.remove(l);
				l++;
			}
			if(lee.isVowel(sc[r])) {
				myMap.put(r,sc[r]);
				tsize = myMap.size();
				rep=rep<tsize?tsize:rep;
			}
		}
		return rep;
    }
	public static int maxVowelsOld(String s, int k) {
		int rep = 0;
		List<Character> a = new ArrayList<>(); 
		a.add('a');
		a.add('e');
		a.add('i');
		a.add('o');
		a.add('u');
		char[] sc = s.toCharArray();
		for(int l=0,r=0;r<s.length();r++) {
			if(r==k||r-l>=k) {
				l++;
			}
			int tempc = 0;
			int temp =l;
			while(temp<=r) {
				if(a.contains(sc[temp])) {
					tempc++;
				}
				temp++;
			}
			rep=rep<tempc?tempc:rep;
			//if(rep<tempc) {rep=tempc;}
		}
		return rep;
    }
